import React from 'react';
import { Grid } from '@material-ui/core';
import Product from './Product/Product';
import useStyles from "./"

const products = [
    {id:1,name:"shoes",description:"Running shoes",price:"$5",image:"https://static.nike.com/a/images/t_PDP_1280_v1/f_auto,q_auto:eco/a50d62bd-5802-47cd-8952-31e746332ecc/react-miler-2-road-running-shoes-wN5bDN.png"},
    {id:1,name:"MacBook",description:"Apple MacBook",price:"$10",image:"https://www.apple.com/v/macbook-pro-13/j/images/overview/hero_endframe__bsza6x4fldiq_large_2x.jpg"}
]

const Products = () => {
  return (
      <main>
          <Grid container justifyContent="center" spacing={4}>  
            {products.map((product)=>(
                <Grid item key={product.id} xs={12} sm={6} md={4} lg={3}>
                    <Product product={product} />
                </Grid>
            ))}
          </Grid>
      </main>
  );
};
export default Products;
